/*!50003 CREATE*/ /*!50020 DEFINER=`edmaku`@`192.168.1.%`*/ /*!50003 FUNCTION `insertarSobranteYAcumulado`(
											 CabinaIdActual		VARCHAR(4),
											 FechaInicio 		VARCHAR(15),
											 FechaFin 			VARCHAR(15)
										   ) RETURNS varchar(30) CHARSET utf8
BEGIN

	DECLARE IdNow						VARCHAR(15);
	DECLARE SobranteAcumNow				VARCHAR(15);
	DECLARE AcumuladoNow				VARCHAR(15);
	DECLARE ContadorDia					VARCHAR(15);

	SET ContadorDia = DAY(FechaInicio);

    REPEAT

BEGIN

		SELECT
				Id
					INTO IdNow
		FROM
				balance
		WHERE
				CABINA_Id 	= CabinaIdActual
			AND Fecha 		= CONCAT(YEAR(FechaInicio),'-',MONTH(FechaInicio),'-',ContadorDia);

		SELECT
				sobranteAcum(Fecha,Id,CABINA_Id,MontoBanco,RecargaVentasMov,RecargaVentasClaro,TraficoCapturaDollar)
					INTO SobranteAcumNow
		FROM
				balance
		WHERE
				CABINA_Id 	= CabinaIdActual
			AND Fecha 		= CONCAT(YEAR(FechaInicio),'-',MONTH(FechaInicio),'-',ContadorDia);


		SELECT
				difCapturaAcum(Fecha,Id,CABINA_Id,TraficoCapturaDollar)
					INTO AcumuladoNow
		FROM
				balance
		WHERE
				CABINA_Id 	= CabinaIdActual
			AND Fecha 		= CONCAT(YEAR(FechaInicio),'-',MONTH(FechaInicio),'-',ContadorDia);


		UPDATE balance SET Acumulado = AcumuladoNow, SobranteAcum = SobranteAcumNow WHERE Id = IdNow;

		SET ContadorDia = ContadorDia + 1;
END;
	UNTIL FechaFin >= CONCAT(YEAR(FechaInicio),'-',MONTH(FechaInicio),'-',ContadorDia)

	END REPEAT;

	RETURN CONCAT('¡EEExito!');

END */;;
DELIMITER ;
