/*!50003 CREATE*/ /*!50020 DEFINER=`edmaku`@`192.168.1.%`*/ /*!50003 FUNCTION `sobranteActual`(
								  IDBalanceActual 				VARCHAR(15),
								  MontoBancoActual 				VARCHAR(15),
								  RecargaVentasMovActual 		VARCHAR(15),
								  RecargaVentasClaroActual 		VARCHAR(15),
								  TraficoCapturaDollarActual 	VARCHAR(15)
								) RETURNS varchar(30) CHARSET utf8
BEGIN

	DECLARE Sobrante 					VARCHAR(30);
	DECLARE Paridad 					VARCHAR(30);
	DECLARE DifBanco 					VARCHAR(30);
	DECLARE DifClaro 					VARCHAR(30);
	DECLARE DifMovistar 				VARCHAR(30);
	DECLARE DifCaptura 					VARCHAR(30);
	DECLARE DifBrightstar 				VARCHAR(30);
	DECLARE Diferenciales 				VARCHAR(30);

	SELECT 	
			IFNULL(p.Valor,0)
			INTO
					Paridad
			FROM 	
					balance b,
					paridad p 
			WHERE
				b.PARIDAD_Id  = p.Id
				AND b.Id	  = IDBalanceActual;

	SELECT
		 (
			IFNULL(MontoBancoActual,0) -
			(
				  IFNULL(FijoLocal			 ,0)
				+ IFNULL(FijoProvincia		 ,0)
				+ IFNULL(FijoLima			 ,0)
				+ IFNULL(Rural				 ,0)
				+ IFNULL(Celular			 ,0)
				+ IFNULL(LDI				 ,0)
				+ IFNULL(RecargaCelularMov	 ,0)
				+ IFNULL(RecargaFonoYaMov	 ,0)
				+ IFNULL(RecargaCelularClaro ,0)
				+ IFNULL(RecargaFonoClaro	 ,0)
				+ IFNULL(OtrosServicios		 ,0)
		    )
		 )

		 INTO
				DifBanco 
		 FROM
				balance
		 WHERE
				Id = IDBalanceActual;

	SELECT
		 (
			(
				  IFNULL(FijoLocal		,0)
				+ IFNULL(FijoProvincia	,0)
				+ IFNULL(FijoLima		,0)
				+ IFNULL(Rural			,0)
				+ IFNULL(Celular		,0)
				+ IFNULL(LDI			,0)
			)
				- ( IFNULL(TraficoCapturaDollarActual,0) * IFNULL(Paridad,0) )
		 )	

		 INTO
				DifCaptura 
		 FROM
				balance
		 WHERE
				Id = IDBalanceActual;

	SELECT
		 (
				IFNULL(RecargaVentasClaroActual ,0) -
			  ( IFNULL(RecargaCelularClaro		,0) + IFNULL(RecargaFonoClaro,0) )
		 )	

		 INTO
				DifClaro 
		 FROM
				balance
		 WHERE
				Id = IDBalanceActual;

	SELECT
		 (
				IFNULL(RecargaVentasMovActual ,0) -
			  ( IFNULL(RecargaCelularMov	  ,0) + IFNULL(RecargaFonoYaMov,0) )
		 )	

		 INTO
				DifMovistar
		 FROM
				balance
		 WHERE
				Id = IDBalanceActual;


	SET DifBrightstar = (DifClaro + DifMovistar);

	SET Diferenciales = (DifBanco + DifCaptura + DifBrightstar);

	SET Sobrante  = (Diferenciales/IFNULL(Paridad,0));

	#RETURN TRUNCATE(Sobrante,2);
	RETURN Sobrante;

END */;;
DELIMITER ;
