/*!50003 CREATE*/ /*!50020 DEFINER=`edmaku`@`192.168.1.%`*/ /*!50003 FUNCTION `sobranteSum`(FechaBalance VARCHAR(15)) RETURNS varchar(30) CHARSET utf8
BEGIN

	DECLARE Sobrante 					VARCHAR(30);
	DECLARE Paridad 					VARCHAR(30);
	DECLARE DifBanco 					VARCHAR(30);
	DECLARE DifClaro 					VARCHAR(30);
