	DECLARE Diferenciales 				VARCHAR(30);

	SELECT 	
			IFNULL(p.Valor,0)
			INTO
					Paridad
			FROM 	
					balance b,
					paridad p 
			WHERE
					b.PARIDAD_Id  	= p.Id
				AND b.Fecha	  		= FechaBalance
				LIMIT 1;

	SELECT
		 SUM(
				IFNULL(MontoBanco,0) -
				(
					  IFNULL(FijoLocal			 ,0)
					+ IFNULL(FijoProvincia		 ,0)
					+ IFNULL(FijoLima			 ,0)
					+ IFNULL(Rural				 ,0)
					+ IFNULL(Celular			 ,0)
					+ IFNULL(LDI				 ,0)
					+ IFNULL(RecargaCelularMov	 ,0)
					+ IFNULL(RecargaFonoYaMov	 ,0)
					+ IFNULL(RecargaCelularClaro ,0)
					+ IFNULL(RecargaFonoClaro	 ,0)
					+ IFNULL(OtrosServicios		 ,0)
				)
			)

		 INTO
				DifBanco 
		 FROM
				balance
		 WHERE
				Fecha = FechaBalance;

	SELECT
		 SUM(
				(
					  IFNULL(FijoLocal		,0)
					+ IFNULL(FijoProvincia	,0)
					+ IFNULL(FijoLima		,0)
					+ IFNULL(Rural			,0)
					+ IFNULL(Celular		,0)
					+ IFNULL(LDI			,0)
				)
					- ( IFNULL(TraficoCapturaDollar,0) * IFNULL(Paridad,0) )
			 )

		 INTO
				DifCaptura 
		 FROM
				balance
		 WHERE
				Fecha = FechaBalance;

	SELECT
		 SUM(
					IFNULL(RecargaVentasClaro ,0) -
				  ( IFNULL(RecargaCelularClaro,0) + IFNULL(RecargaFonoClaro,0) )
			 )	

		 INTO
				DifClaro 
		 FROM
				balance
		 WHERE
				Fecha = FechaBalance;

	SELECT
		 SUM(
					IFNULL(RecargaVentasMov ,0) -
				  ( IFNULL(RecargaCelularMov,0) + IFNULL(RecargaFonoYaMov,0) )
			 )	

		 INTO
				DifMovistar
		 FROM
				balance
		 WHERE
				Fecha = FechaBalance;


	SET DifBrightstar = (DifClaro + DifMovistar);

	SET Diferenciales = (DifBanco + DifCaptura + DifBrightstar);

	SET Sobrante  = (Diferenciales/IFNULL(Paridad,0));

	#RETURN TRUNCATE(Sobrante,2);
	RETURN Sobrante;

END */;;
DELIMITER ;
